import { Header, Segment } from 'semantic-ui-react';

const SiteHeader = () => (
    <header>
        <Segment clearing>
            <Header as='h2' floated='right'>
                Charlie Leopard
    </Header>
           
        </Segment>
    </header>
)


export default SiteHeader;
